import React from 'react';
import logo from './logo.svg';
import { Routes, Route, Link } from "react-router-dom";
import './App.css';

//Screens 
import UserSearchScreen from './screens/usersSearch/UsersSearch';
import RepositoriesSearchScreen from './screens/usersSearch/UsersSearch';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/*">
          <Route index element={<UserSearchScreen />} />
          <Route path="repositories" element={<RepositoriesSearchScreen />} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
